import WebDesign from "../../img/presentation-web-design.png";

export default function BoxProject({setDetail}) {

    return (
        <div className="col-lg-4 mb-4" onClick={()=> setDetail("projet1")}>
            <div style={{
                borderRadius: 18,
                height: 308,
                overflow: "hidden",
                cursor: "pointer",
                display: "flex",
                alignItems: "center"
            }}>
                <img src={WebDesign} alt="#" height="100%" />
            </div>
        </div>
    )
}
